import editIcon from '../svg/edit.svg';

export default class MagentoWidget {
    constructor({ data, config, api, readOnly }) {
        this.api = api;
        this.readOnly = readOnly;
        this._CSS = {
            block: this.api.styles.block,
            settingsButton: this.api.styles.settingsButton,
            settingsButtonActive: this.api.styles.settingsButtonActive,
            wrapper: 'ce-header',
        };
        this._settings = config;
        this._data = this.normalizeData(data);
        this._element = this.createElement();
        this.updateElement();
    }

    static get toolbox() {
        return {
            title: 'Magento Widget',
            icon: '<img width="24" src="'+MagentoWidget.getIconString()+'">'
        };
    }

    static getIconString() {
        return 'data:image/svg+xml;base64,';
    }

    static get isReadOnlySupported() {
        return true;
    }

    normalizeData(data) {
        const newData = {};

        if (typeof data !== 'object') {
            data = {};
        }

        newData.name    = data.name || null;
        newData.options = data.options || {};

        return newData;
    }

    render(){
        return this._element;
    }

    createElement() {
        const tag = document.createElement("span");
        return tag;
    }

    updateElement() {
        var name = this._data.name || "NEW";
        this._element.innerHTML = "Magento Widget [" + name + "]";

        if (this._data.name) {
            this._element.id =  Base64.idEncode(this.encodeWidgetCode());
        }
    }

    isConfigured() {
        return this._data.name != null;
    }

    decodeWidgetCode(widgetCode) {
        this._data.options = {};
        widgetCode.gsub(/([a-z0-9\_]+)\s*\=\s*[\"]{1}([^\"]+)[\"]{1}/i, function (match) {
            if (match[1] == 'type') {
                this._data.name = match[2].split("\\").pop();
            }
            this._data.options[match[1]] = match[2];
        }.bind(this));
        this.updateElement();
    }

    encodeWidgetCode() {
        var widgetCode = "{{widget ";
        for (const [key, value] of Object.entries(this._data.options)) {
            widgetCode += key + "=\"" + value + "\" ";
        }
        widgetCode += "}}";
        return widgetCode;
    }

    extractType(widgetCode) {
        var type = null;
        if (widgetCode.indexOf('{{widget') !== -1) {
            widgetCode.gsub(/([a-z0-9\_]+)\s*\=\s*[\"]{1}([^\"]+)[\"]{1}/i, function (match) {
                if (match[1] == 'type') {
                    type = match[2];
                }
            });
        }
        return type;
    }

    renderSettings() {
        const holder       = document.createElement('DIV');
        const configButton = document.createElement('SPAN');
        const windowUrl    = this._settings.windowUrl;
        const editorId     = this._settings.editorId;

        configButton.classList.add(this._CSS.settingsButton);
        configButton.innerHTML = editIcon;
        configButton.addEventListener('click', function () {
            widgetTools.setEditMode(this.isConfigured());

            // behave like widget.js expects it
            // var speudoElement = document.createElement('DIV');
            // speudoElement.id  = this._element.id; // id will hold base64 encoded widget settings
            // widgetTools.setActiveSelectedNode(speudoElement);

            window.EditorJSPlugin.hideLayoutDialog();
            widgetTools.openDialog(
                windowUrl + 'widget_target_id/' + editorId + '/'
            );
        }.bind(this));
        holder.appendChild(configButton);

        return holder;
    }

    save(blockContent) {
        return this._data;
    }
}
